import React from 'react'
import { Link } from 'react-router-dom';
import Home from '../Home/Home';

function Library() {
  return (
    <div>
        <h1>Library</h1>
        <Link to={'/Home'}>home</Link>
        <Link to={'/network'}>home</Link>
    </div>
  );
}

export default Library
